Justice League of America v3 #11
Publisher:  DC Comics
Publication Date:  January 15, 2014

Writer:  Matt Kindt
Penciller:  Tom Derenick and Eddy Barrows
Inkers:  Tom Derenick, Eber Ferreira, Ruy Jose, and Allen Martinez
Colorists:  Hi-Fi
Letterer:  Rob Leigh
Cover:  Eddy Barrows, Eber Ferreira, and Marcelo Maiolo

A FOREVER EVIL tie-in! Survivors Martian Manhunter and Stargirl make a perilous trek across a Super-Villain occupied United States. Their first stop may be the last as they enter Gotham City and Clayface-occupied territory.

Thanks goes to Shining Knight for this release.

